import React from 'react';

const AddressSection = ({line1, city, state, zip, handleInputChange}) => {
  return(
    <>
    <div className="row">
    <div className="col">
    <input
    name="line1"
    placeholder="Address"
    required
    value={line1}
    onChange={handleInputChange}
    />
    </div>
    </div>
    <div className="row">
    <input
    name="city"
    placeholder="City"
    required
    value={city}
    onChange={handleInputChange}
    />
    <input
    name="state"
    placeholder="State"
    required
    value={state}
    onChange={handleInputChange}
    />
    <input
    name="zip"
    placeholder="Zip"
    required
    value={zip}
    onChange={handleInputChange}
    />
    </div>
    </>
  )
}

export default AddressSection;
